import "./Home.css"

const Home = () => {
  return (
    <div className="container-home">
      <h1>Cineverse</h1>
      <p>The Home of the Best Movies</p>

      <img
        src="https://image.tmdb.org/t/p/original/5YZbUmjbMa3ClvSW1Wj3D6XGolb.jpg"
        alt="image_galaxy"
        className="poster"
      />
    </div>
  );
};

export default Home;
